import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Map from './Map';
import TransitInfo from './TransitInfo';
import './styles.css'; // Add this line at the top


const App = () => {
    return (
        <div>
            <Header />
            <div className="container my-4">
                <Map />
                <TransitInfo />
            </div>
            <Footer />
        </div>
    );
};

export default App;
